                .animation3.active .piso,
                .animation3.active .cubo,
                .animation3.active .tapa{
                    opacity: 0;
                    transform: translateY(20px);
                    animation: animation3piso 1s ease forwards;
                }
                .animation3.active .piso1{
                    animation-delay: 1s;
                }
                .animation3.active .piso2{
                    animation-delay: 1.5s;
                }
                .animation3.active .piso3{
                    animation-delay: 2s;
                }

                .animation3.active .cubo{
                    animation-delay: 2s;
                }
                .animation3.active .tapa{
                    transform: translateY(-100px);
                    animation-delay: 2s;
                }
                @keyframes animation3piso{
                    to{
                        transform: none;
                        opacity: 1;
                    }
                }

                .animation3.active .luces{
                    opacity: 0;
                    animation: luces 1s ease forwards;
                    animation-delay: 3s;
                }
                @keyframes luces{
                    to{
                        opacity: 1;
                    }
                }

                @keyframes animation3gravity{
                    0%{
                        opacity: 1;
                        transform: translateY(0);
                    }
                    100%{
                        opacity: 1;
                        transform: translateY(50px);
                    }
                }
                @keyframes animation3intermitente{
                    from{
                        opacity: 1;
                    }
                    to{
                        opacity: 0.3;
                    }
                }

            <script>
                const animation3 = document.querySelector('svg.animation3')
                setTimeout(()=>{
                    if(animation3.classList.contains('active')){
                        let time = 0;
                        animation3.querySelectorAll('.tapa').forEach(tapa=>{
                            time = time+1000
                            setTimeout(()=>{
                                tapa.style.animation = "animation3gravity 3s ease infinite alternate"
                            },time)
                        })
                        animation3.querySelector('.cubocentral').style.animation = "animation3gravity 5s linear infinite alternate"
                        animation3.querySelectorAll('.luces').forEach(luz=>{
                            const random = Math.random()*5000
                            setTimeout(()=>{
                                luz.style.animation = "animation3intermitente 3s ease infinite alternate"
                            },random+3000)
                        })
                    }
                },3500)
            </script>
